    "["Use Constraints: DO NOT USE ESI MAPS FOR NAVIGATIONAL PURPOSES. Besides the
    above warning, there are no use constraints on these data. Note that the ESI maps
    should not be used to the exclusion of other pertinent data or information held
    by state or federal agencies or other organizations. Likewise, information contained
    in the maps cannot be used in place of consultations with environmental, natural
    resource, and cultural resource agencies, or in place of field surveys. Recognize
    that the information contained in the ESI maps represents known concentration areas
    or occurrences of natural, cultural, and human-use resources, but does not necessarily
    represent the full distribution or range of each species or resource. This is particularly
    important to recognize when considering potential impacts to protected resources,
    such as endangered species, wetlands, etc. Acknowledgment of the originators, publishers,
